      public static EdgeWeightedDigraph CreateEdgeWeightedDigraphFromFile( string path )
      {
         EdgeWeightedDigraph graph;

         using ( StreamReader sr = new StreamReader( path ) )
         {
            int vertices = Int32.Parse( sr.ReadLine() );
            int edges = Int32.Parse( sr.ReadLine() );

            graph = new EdgeWeightedDigraph( vertices );

            for ( int i = 0; i < edges; i++ )
            {
               string line = sr.ReadLine();
               string[] tokens = line.Split( " ", StringSplitOptions.RemoveEmptyEntries );
               graph.AddEdge( new DirectedEdge( int.Parse( tokens[0] ), int.Parse( tokens[1] ), double.Parse( tokens[2] ) ) );
            }
         }

         return graph;
      }

